[] rdfs:comment "A Connection must only have a cnx relation with a ConnectionPoint" ;
    sh:path <http://data.ashrae.org/standard223#cnx> ;
    sh:sparql [ a sh:SPARQLConstraint ;
            rdfs:comment "A Connection must only have a cnx relation with a ConnectionPoint" ;
